class Solution:
    """Approach 2: Traverse temp array in forward direction.
       Time complexity: O(2n) represents for loop and while loop for length of T
       Space complexity: O(W) to store list of strictly increasing temperatures
                         in stack
       Runtime: 488 ms
       Memory: 19 MB
    """
    def dailyTemperatures(self, T):

        # preliminary checks
        if len(T) > 30000: return 'Invalid list length.'
        for temp in T:
            if temp < 30 or temp > 100:
                return 'Invalid temperature value.'

        # initialize variables
        ans = [0] * len(T)
        warmer_stack= []

        for i, t in enumerate(T):
            print('i:', i, 'T[i]:', t)
            print(warmer_stack)
            while warmer_stack and t > T[warmer_stack[-1]]:
                cur = warmer_stack.pop() # cur refers to temp in stack
                ans[cur] = i - cur # 
            warmer_stack.append(i)
        return ans

